descriptions:
{'es-ES': 'Conjunto de dos bordas para rehabilitar en el bonito pueblo de Oros Bajo, junto a la famosa cascada, en el Alto Gallego a los pies del Valle de Tena, sobre parcela de 1.100 m2, 686 m2 construidos.

Posibilidad de convertirlas en 4 viviendas adosadas de 170 m2 individualmente con jardín privado y zonas comunitarias, también existe la posibilidad de realizar promoción de apartamentos, pudiendo salir unos 8 apartamentos, bajos con jardín y bonitos áticos abuhardillados.

Muy buena inversión para promotores.'}

{'es-ES': "Precioso y cuidado apartamento en Edificio Castillo D'Acher, en el bonito pueblo de Hecho, dentro del Valle de Hecho.

51 m2 construidos en una primera planta, muy bien distribuido, cuenta con un amplio dormitorio de matrimonio, un baño con bañera, amplio salón comedor con cocina americana y chimenea de leña, balcón de construcción típica que hace que sea una vivienda muy especial. La vivienda por su orientación sur es super soleada y luminosa.

El edificio se construyo en 2007 y se trata de una segunda residencia en perfecto estado para entrar a vivir, en la planta sótano dispone de una buena plaza de parking."}

{'es-ES': 'Características:
85 m2 3 hab con armarios empotrados, 1 baño, cocina grande con lavadero, salón comedor, terraza 12m2, garaje y 2 trasteros. Zona comunitaria con: piscina, pista de tenis y jardín inmenso.

'}

{'es-ES': 'Casa en la Sierra de Guara (Huesca), Parque Natural, lugar de práctica de deportes de aventura, ornitología, geología, enología, arquitectura, etc.  Ubicada en el centro del pueblo, cercana a la plaza, Ayuntamiento, Iglesia y Monasterio de Nuestra Señora de la Gloria. Pueblo con piscinas municipales, telecentro, consultorio médico, local social, fibra óptica de alta velocidad, y recepción de 4 G para telefonía móvil. Muy buenas comunicaciones, a menos de 30 km de Barbastro y de Huesca. Ideal para quien busca une entorno rural tranquilo y con posibilidades.
Casa con tres alturas, son 177 m2 construidos (165 m2 útiles).La vivienda fue reformada: Instalación eléctrica, fontanería, cerramientos con rotura de puente térmico, parqué, bodega, trastero con caldera, leñero, pozo y jardineras en patio interior, cocina-salón con hogar, dos habitaciones y loft de 45 m2, terraza, calefacción inverter, dos baños (planta baja y bajo cubierta) y un aseo (planta primera).

'}

{'es-ES': 'Espectacular casa rustica totalmente rehabilitada, en la zona de la solana, dentro del bonito pueblo de Araguas del Solano.

228 m2 distribuidos en tres plantas, planta de acceso donde encontramos un bonito vestíbulo que da acceso a plantas superiores, a la cocina comedor con chimenea, a la terraza de 20 m2 con orientación sur, muy soleada, un jardín trasero en dos alturas de 60 m2, dos dormitorios y un baño completo y la sala de lavandería/calderas. Accedemos a la planta intermedia diáfana abuhardillada donde encontramos un precioso por su singularidad salón, un amplio dormitorio principal abierto al salón, otros dos dormitorios dobles con armarios empotrados y dos baños. En la planta superior se encuentra la buhardilla diáfana con posibilidad de realizar dos dormitorios mas.

En estado de reestreno, totalmente amueblada y equipada, para entrar a vivir.'}

{'es-ES': 'Gran borda tradicional a rehabilitar, construida en piedra y losa, de dos plantas.

Con parcela de 800m2, y muros en buen estado.

Situada en un pequeño pueblo en la ruta que conduce al Parque Nacional de Ordesa y Monte Perdido, por la zona de Torla.'}

{'es-ES': 'En pleno centro del pueblo de Villanua, disponemos de esta vivienda tan peculiar.

Se trata de un apartamento "dúplex", de 63 m2 distribuidos en dos plantas, en la planta inferior y de acceso desde la calle se encuentra un dormitorio doble con aseo y un cuarto trastero, accediendo a la primera planta por el acceso comunitario, entramos en la vivienda, donde se ubica la parte principal, un gran dormitorio, un baño, salón y cocina.

Su calefacción es de gasoil individual, se encuentra en muy buen estado de uso, ideal como segunda residencia, llámenos para visitarla, muy buena oportunidad!'}

{'es-ES': 'Casa corral con jardín de 398 m2 construidos, sobre parcela de 310 m2.

En estado de reforma, se puede tirar la construcción actual y hacer una nueva según las limitaciones del Ayuntamiento, o respetar y rehabilitar las construcciones actuales.

Una muy buena oportunidad!'}

{'es-ES': 'En pleno centro de la localidad de Biescas

Piso de tres dormitorios, baño completo, cocina independiente y salón todo ello para reformar.

La población de Biescas se encuentra ubicada a escasos km de las estaciones de esqui Formigal-Panticosa y cerca de Ordesa y Monte perdido, sin lugar a duda uno de los pueblos con mas ambiente y vida del Valle de Tena.'}

{'es-ES': 'Bonito y cuidado apartamento para empezar a disfrutar de el esta misma temporada, en uno de los mejores edificios de Astun, Edificio Atalaya, a pie de pistas con acceso por C/ Escalar, zona de parking para propietarios.

Dispone de un pasillo que da acceso a la vivienda, donde encontramos un armario guarda esquis y equipacion de toda la familia, un amplio baño, accedemos al gran y amplio salon comedor con cocina americana, el cual tiene unas bonitas vistas hacia Candanchu. Dispone de un dormitorio abierto con capacidad para cama de matrimonio litera, la capacidad total del apartamento actualmente es de 5 personas contando con el sofa cama.

Disponible para visitarlo, le encantara! '}

{'es-ES': 'Planta baja en La Puebla de Castro un entorno privilegiados del Pre-pirineo de HUESCA. Muy cerca del Lago Barasona donde podrás practicar diversos deportes acuáticos, el pueblo dispone de tiendas, Bar y un complejo deportivo con Piscina, Campo de fútbol y fútbol sala, Frontón, pistas de tenis, 72 m. de superficie construida, 7 m2 de cocina independiente con salida a terraza de 15 m2., 20 m2 de comedor, balcón, 2 habitaciones dobles,  un baño, propiedad seminueva, cocina equipada, carpinteria interior de nogal, orientación este oeste, parquet, carpintería exterior de aluminio / climalit. Extras: acceso pmr, agua, balcón, calefacción, luminoso, luz, puerta blindada, terraza, autobuses, céntrico, centros médicos, colegios, montaña. ¡¡¡ MUY SOLEADO!!! ¡¡¡ TAMBIEN EN ALQUILER CON OPCION A COMPRA con prima de compra 10 %!!! 

 Venta: 79000 €
 Alquiler: 400 € MES'}

{'es-ES': 'En pleno casco antiguo de Jaca le ofrecemos esta bonita vivienda que reúne la construcción típica de montaña, con piedra, vigas y suelos de madera.

Dispone de 2 amplios dormitorios, un gran baño con hidromasaje y una despensa, salón comedor, cocina independiente con cadiera para comer.

La vivienda se encuentra en un edificio de tres vecinos, no dispone de ascensor pero es una primera planta muy cómoda, luminosa y soleada, en la planta baja tiene un buen trastero incluido en el precio.'}

{'es-ES': 'Ático de 65 m2, con salón comedor con chimenea de leña, cocina independiente, 2 habitaciones y un baño completo. Cocina y baño totalmente equipados. Caldera de agua y calefacción individual. Las habitaciones y pasillo poseen armarios empotrados completamente revestidos interiormente. Todas las habitaciones disponen de ventanas al exterior. Gastos de comunidad, 35 eurosmes.

Orientación oeste, muy soleado, en urbanización con parking privado y piscina con zona verde, a 5 minutos del centro de Jaca, zona muy tranquila. Se dejaría sin amueblar.

Estado de la vivienda: Para entrar a vivir.'}

{'es-ES': 'Huerta rustica, en Castiello de Jaca, a 5 minutos de Jaca, una zona inmejorable, super soleada y luminosa, con una construcción actual de 50 m2 construidos.

Actualmente dispone de una vivienda de 50 m2 construidos en dos plantas, planta baja donde se encuentra el comedor cocina y un pequeño baño, un porche cerrado y acristalado y en la planta de arriba un aprovechamiento bajo cubierta con ventana al exterior, jardín/huerto de 585 m2, vallado con muro de piedra y puerta de acceso para vehículos, tiene un pequeño trastero exterior y pozo.

La casa dispone de pre-instalación eléctrica, pero actualmente no tiene luz, ya que su uso es de finca de recreo.'}

{'es-ES': 'Casa de 456 m2 construidos en 4 plantas en pleno casco antiguo de Jaca, para rehabilitar.

Sobre parcela de 128 m2, el edificio se encuentra en estado original, mantenido, ideal para rehabilitarlo y segregarlo en viviendas, o rentabilizarlo como negocio. En la planta baja cuenta con un local comercial y garaje privado, la primera planta es la mejor mantenida y en uso actualmente, planta segunda en desuso y planta bajo cubierta diáfana con posibilidad de elevar altura.

Una muy buena oportunidad de compra.'}

{'es-ES': 'Bonito dúplex de 90 m2 útiles con tres dormitorios, dos baños, cocina americana con zona de comedor con preinstalación de chimenea, suelos de parquet, calefacción de gas, pocos gastos de comunidad, enclavado en el Valle de Tena junto al pantano de Lanuza una zona privilegiada con estupendas vistas del valle, a escasos kilómetros de las pistas de esquí de Panticosa y Formigal.

Tal y como entramos por la puerta nos encontramos con un bonito recibidor que distribuye hacia la zona de cocina comedor, un baño con plato de ducha y un dormitorio, la cocina americana comedor es amplio con preinstalación de chimenea de leña y balconcito hacia el pueblo, accedemos por las escaleras a la planta superior donde encontramos una estancia diáfana que seria la zona del salón, un segundo baño y otro dormitorio principal, desde la zona del salón hay una escalera que se accede a la buhardilla donde se encontraría el tercer dormitorio.

En la planta de acceso tiene 49 m2 construidos, en la segunda planta 47 m2 construidos y en el altillo son 11 m2 construidos.'}

{'es-ES': 'Casa para rehabilitar diafana en el bonito y unico pueblo de Anso, uno de los catalogados como mas bonitos de España.

243 m2 construidos, distribuidos en dos plantas, al final del pueblo con unas envidias vistas del valle y la ribera, acceso peatonal a la casa, dispone una bonita terraza mirador, 118 m2 por planta en las que poder distribuir a su gusto y construir la casa de sus sueños en un paraje impresionante como es Anso y su valle.

Precio negociable!'}

{'es-ES': 'Espectacular Chalet ubicado en Sesúe, con unas vistas inmejorables al Valle donde podrás disfrutar de momentos únicos con tu familia y amigos. La casa está construida en una parcela de 13740 M2, con acceso privado a la finca, y en el jardín encontraras una gran piscina de 15.000 litros de agua mineral, construida sobre una roca natural en forma de riñón, y para hacer deporte tiene un magnifico frontón.

La construcción es con materiales y acabados de primera calidad, la casa cuenta con 2 plantas y sótano, al entra a la casa nos encontramos con un gran salón muy acogedor con chimenea y un gran ventanal con las mejores vistas al Valle, también tiene una sala de juegos con una mesa de billar, después nos encontramos con la cocina integrada con el comedor con chimenea, tiene 4 habitaciones amplias, 5 baños y un sauna, en el sótano encontramos un gran bodega, el garaje es para 6 coches, la calefacción es de gasóleo con un depósito de 10.000 litros.

Aprovecha esta oportunidad !!! La casa está lista para entrar a vivir ...'}

{'es-ES': 'Piso en venta en la Avenida del Parque, 54 de Huesca. 


Inmueble de 68 metros cuadrados con suelo de parquet. Consta de salón, 3 habitaciones y un  cuarto de baño. Tiene toma de gas. Necesita una pequeña reforma. El patio está reformado y el bloque tiene ascensor. Pocos gastos de comunidad. 
'}

{'es-ES': '¡ESTUPENDA OPORTUNIDAD! PRECIOSO PISO CON GARAJE, TRASTERO MÁS ESTUDIO, EN PLENO CENTRO DE SABIÑANIGO. Completamente amueblado, dispone de 2 dormitorios dobles, salón-comedor muy luminoso, cocina completamente equipada, baño y terraza.
La vivienda se vende, INCLUIDA EN EL PRECIO, con trastero, plaza de garaje, más un estudio reformado con baño y cocina ubicado la planta calle del mismo edificio.

VENGA A VISITARLA, QUEDARA ENCANTADO.'}

{'es-ES': 'Si lo que buscas es vivir en una casa independiente, en plena naturaleza, dentro de una urbanización que te proporcione todos los servicios y la seguridad que necesitas, entonces tenemos lo que buscas. A pocos kilómetros de Huesca, junto al campo de golf de Nueno, en la Urbanización Parque Guara, es la casa perfecta. 

 800 mts de parcela, con piscina privada, zona de barbacoa y un gran jardín. La casa tiene más de 200 mts con varias terrazas para disfrutar de las vistas y del aire libre, está reformada, con todas las comodidades para entrar a vivir (calefacción, bodega con chimenea, persianas eléctricas, aire acondicionado, etc.). Además, la urbanización dispone de zonas comunes, pistas de tenis, fútbol, baloncesto, piscina... .

 Llámanos y quedamos para verla, seguro que te la quedarás.'}

{'es-ES': 'Piso situado en el municipio de Jaca, en la provincia de Huesca. Ocupa una extensión de 86,58 m² que se distribuyen en tres dormitorios, dos cuartos de baño, salón-comedor y cocina. 

Se encuentra en la zona centro de la localidad, situación que le otorga una gran cercanía a todo tipo de servicios y negocios locales, tales como restaurantes, supermercados, centros educativos y médicos o sucursales bancarias, entre otros.

En cuanto a las vías de acceso por carretera, las más habituales por su uso son N-330a, E-7 y N-240.'}

{'es-ES': 'Estupendo apartamento en estado de reestreno, en edificio de reciente construcción en plena calle Albareda de Canfranc Pueblo.

Dispone de dos dormitorios, uno de ellos con litera y otro muy grande con cama de matrimonio, las habitaciones tienen orientación este, muy luminosas y soleadas por la mañana, un baño completo con plato de ducha, amplio salón comedor con cocina americana reformada en obra, el salón da hacia la propia calle Albareda con orientación oeste, soleado de tardes.

En la planta sótano dispone de plaza de parking y trastero incluidos en el precio, el edificio tiene ascensor para acceder desde el portal a la vivienda y al garaje, con plena accesibilidad para minusválidos.'}

{'es-ES': 'Si estas buscando una casa para reformar en Grañen es lo que estas buscando. 

En el centro de Grañen, en la plaza España, con una superficie aproximada de 250 metros te ofrecemos este inmueble para hacerte la casa a tu medida. A un precio muy asequible tienes la oportunidad de modelar a tu gusto todo este espacio.

Llámanos para ir a verla.[IW]'}

{'es-ES': 'Características:
65 m² con 2 hab que dan a un balcón grande, cocina completa, salón comedor, 1 baño completo. Garaje y trastero. Muy soleado. Calefacción individual de gas.

'}

{'es-ES': 'Tiene 105 m² distribuidos en 4 habitaciones, 2 baños completos, cocina independiente y salón comedor con dos balcones.)
Calefacción individual electricos y chimenea.

'}
